?><p style="font-family: Arial, Verdana, sans-serif; font-size: 12px; text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Истоки этой часовой компании следует искать в начале 20-го века, а если быть точнее, в 1920-ом году. Изначально, эта компания специализировалась на производстве палубных часов (кстати, большинство мореплавателей рекомендовали продукцию именно этой компании). Через несколько десятков лет было принято решение о расширении ассортимента. Были разработаны первые наручные часы, которые сразу же стали популярны и имели огромный успех. На сегодняшний день, в ассортименте компании&nbsp;<span lang="EN-US">Zeno</span><span lang="EN-US">&nbsp;</span>присутствуют 8 коллекций, каждая из которых имеет собственные отличия, как в дизайнерских решениях, так и в технической начинке. Часы&nbsp;<span lang="EN-US">Zeno</span><span lang="EN-US">&nbsp;</span>отлично подойдут людям, которые привыкли вести активный образ жизни и не стоять на одном месте.</span></span></p>

